import React from 'react';
import sdata from './Sdata'

function zcard(val)
{
    console.log(val.title);
    return (
    <>
    <div className="row">
    <div className="card">
    <img src="computers.png" alt="Avatar" className="card_img"/>
    <div className="container">
      <h4><b>{val.title}</b></h4> 
      <p>{val.para}</p> 
    </div>
  </div>
  </div>
  </>
    )
}


function MyCard(prop){
   return(
    <>
{sdata.map(zcard)}
    </>
    )  

}

export default MyCard;
